import{_ as t,c as a,o,ag as n}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP FUNCTION","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_FUNCTION.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_FUNCTION.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_FUNCTION.md"};function s(d,e,c,r,l,p){return o(),a("div",null,e[0]||(e[0]=[n(`<h1 id="drop-function" tabindex="-1">DROP FUNCTION <a class="header-anchor" href="#drop-function" aria-label="Permalink to &quot;DROP FUNCTION&quot;">​</a></h1><p>Removes a function.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP FUNCTION [IF EXISTS] name ( [ [argmode] [argname] argtype [, ...] ] )</span></span>
<span class="line"><span>    [CASCADE | RESTRICT]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP FUNCTION</code> removes the definition of an existing function. To run this command the user must be the owner of the function. The argument types to the function must be specified, since several different functions may exist with the same name and different argument lists.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the function does not exist. A notice is issued in this case.</p><p>name : The name (optionally schema-qualified) of an existing function.</p><p>argmode : The mode of an argument: either <code>IN</code>, <code>OUT</code>, <code>INOUT</code>, or <code>VARIADIC</code>. If omitted, the default is <code>IN</code>. Note that <code>DROP FUNCTION</code> does not actually pay any attention to <code>OUT</code> arguments, since only the input arguments are needed to determine the function&#39;s identity. So it is sufficient to list the <code>IN</code>, <code>INOUT</code>, and <code>VARIADIC</code> arguments.</p><p>argname : The name of an argument. Note that <code>DROP FUNCTION</code> does not actually pay any attention to argument names, since only the argument data types are needed to determine the function&#39;s identity.</p><p>argtype : The data type(s) of the function&#39;s arguments (optionally schema-qualified), if any.</p><p>CASCADE : Automatically drop objects that depend on the function (such as operators).</p><p>RESTRICT : Refuse to drop the function if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>This command removes the square root function:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP FUNCTION sqrt(integer);</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>A <code>DROP FUNCTION</code> statement is defined in the SQL standard, but it is not compatible with this command.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_FUNCTION.html">CREATE FUNCTION</a>, <a href="./ALTER_FUNCTION.html">ALTER FUNCTION</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,22)]))}const u=t(i,[["render",s]]);export{m as __pageData,u as default};
